import React from "react";
import CheckoutForm from "..Components/CheckoutForm/CheckoutFo"; // Import the CheckoutForm component
import Navbar from "../Components/Navbar/Navbar"; // Import the Navbar
import Footer from "../Components/Footer/Footer"; // Import the Footer

const Checkout = () => {
  return (
    <div>
      <Navbar /> {/* Include the Navbar */}
      <div className="container"> {/* Add a container for styling */}
        <h1>Checkout</h1>
        <CheckoutForm /> {/* Render the CheckoutForm component */}
      </div>
      <Footer /> {/* Include the Footer */}
    </div>
  );
};

export default Checkout;
